import { LoginError } from './Types';
import { RematchRootState, RematchDispatch } from '@rematch/core';

type State = ReadonlyArray<LoginError>;

const loginStore = {
  state: [] as State,
  reducers: {
    errors: (state: State, payload: LoginError) => payload,
  },
};

export default loginStore;

export type RootState = RematchRootState<typeof loginStore>;
export type RootDispatch = RematchDispatch<typeof loginStore>;
